import React, { useState, useCallback } from "react";
import CompanyProspectList from "./companyprospect.jsx";

export default function App() {
  const [companyName, setCompanyName] = useState("");
  const [postalCode, setPostalCode] = useState("");
  const [data, setData] = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  const mapCompanyData = (rawData) => {
    if (!Array.isArray(rawData)) return [];
    return rawData.map((ent) => ({
      nom: ent.nom || ent.name || ent.denomination || "",
      secteur: ent.secteur || ent.sector || ent.activite || "",
      resume: ent.resume || ent.summary || ent.description || "",
      adresse: ent.adresse || ent.address || "",
      site_web: ent.site_web || ent.website || "",
      sources: ent.sources || ["Sources internes"],
      contacts: (ent.contacts || []).slice(0, 3).map((c) => ({
        poste: c.poste || c.position || c.title || "",
        nom: c.nom || c.name || "",
        email: c.email || "",
        telephone: c.telephone || c.phone || "",
        linkedin: c.linkedin || "",
      })).filter((c) => c.nom),
    })).filter(ent => ent.nom && ent.contacts.length);
  };

  const handleSearch = async (e) => {
    if (e) e.preventDefault();
    if (!companyName.trim() || !postalCode.trim()) return alert("Nom + CP requis !");

    setLoading(true); setError(null);

    try {
      const response = await fetch("http://localhost:5000/prospect", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ companyName: companyName.trim(), location: postalCode.trim() }),
      });

      if (!response.ok) throw new Error(`HTTP ${response.status}`);

      const json = await response.json();
      const mapped = mapCompanyData(json.data);
      console.log("‚úÖ MAPP√â:", mapped);
      setData(mapped);
    } catch (err) {
      setError(err.message);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="min-h-screen bg-gradient-to-br from-indigo-50 to-blue-50">
      <div className="max-w-6xl mx-auto p-6">
        <h1 className="text-4xl font-bold mb-8 text-gray-800 text-center">üîç Prospection B2B Pro</h1>

        <form onSubmit={handleSearch} className="bg-white p-6 rounded-2xl shadow-xl mb-8">
          <div className="grid md:grid-cols-3 gap-4">
            <input
              value={companyName}
              onChange={(e) => setCompanyName(e.target.value)}
              placeholder="Nom entreprise (ex: Orange)"
              className="p-4 border-2 border-gray-200 rounded-xl focus:ring-4 focus:ring-indigo-500 focus:border-indigo-500"
              disabled={loading}
            />
            <input
              value={postalCode}
              onChange={(e) => setPostalCode(e.target.value)}
              placeholder="Code postal (ex: 75001)"
              className="p-4 border-2 border-gray-200 rounded-xl focus:ring-4 focus:ring-indigo-500 focus:border-indigo-500"
              disabled={loading}
            />
            <button
              type="submit"
              disabled={loading}
              className="p-4 bg-gradient-to-r from-indigo-600 to-purple-600 text-white font-bold rounded-xl hover:from-indigo-700 transition-all shadow-lg"
            >
              {loading ? "üîÑ IA en cours..." : "üöÄ Lancer Recherche"}
            </button>
          </div>
        </form>

        {error && (
          <div className="p-4 mb-6 bg-red-100 border-2 border-red-400 rounded-xl text-red-800 font-semibold">
            ‚ùå {error}
          </div>
        )}

        {loading && (
          <div className="text-center py-16">
            <div className="inline-block animate-spin rounded-full h-12 w-12 border-4 border-indigo-600 border-t-transparent"></div>
            <p className="mt-4 text-xl text-gray-600">‚ö° IA g√©n√®re concurrentes... (10-30s)</p>
          </div>
        )}

        {data.length > 0 && (
          <div>
            <div className="mb-8 text-center">
              <h2 className="text-3xl font-bold text-indigo-600">‚úÖ {data.length} CONCURRENTES trouv√©es !</h2>
            </div>
            <CompanyProspectList data={data} />
          </div>
        )}
      </div>
    </div>
  );
}
